/* eslint-disable jsx-a11y/img-redundant-alt */
import React from "react";
import { useHistory } from "react-router-dom";
import styles from "./dogCard.module.css";

const DogCard = ({ id, name, image, temperament, weight }) => {
  const history = useHistory();
  return (
      <div className={styles.containerCard} onClick={(history.push("/deatilPage"))}>
        <h2>Name: {name}</h2>
        {image.url ? (
          <img src={image.url} className={styles.image} alt="Dog Image"></img>
        ) : (
          <img src={image} className={styles.image} alt="Dog Image"></img>
        )}
        <h2>Temperament: {temperament}</h2>
        {weight.metric ? (
          <h2>
            Weight: {weight.metric} kg
          </h2>
        ) : (
          <h2>Weight: {weight}</h2>
        )}
      </div>
  );
};

export default DogCard;
